"use strict";

$('.toggle').on('click', function () {
  $('.header__menu-items').slideToggle();
  $('toggle').fadeIn(3000, function () {
    $('.toggle').removeClass('.toggle_open');
    $('.toggle').addClass('.toggle_close').fadeOut(3000);
  });
});
